import { useState } from 'react';
// import './PhotoCollection.css';

const PhotoCollection = () => {
  const [showLogin, setShowLogin] = useState(false);
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [clientPassword, setClientPassword] = useState('');

  const handleClientLogin = (e) => {
    e.preventDefault();
    // In a real app, this would be more secure
    if (clientPassword === 'wedding2024') { // Change this password
      setIsAuthenticated(true);
      setClientPassword('');
    } else {
      alert('Invalid password. Please contact the couple for access.');
    }
  };

  const handleLogout = () => {
    setIsAuthenticated(false);
    setShowLogin(false);
  };

  // Client's Google Drive folder link (replace with actual link)
  const clientDriveLink = "https://drive.google.com/drive/folders/YOUR_CLIENT_FOLDER_ID";

  if (isAuthenticated) {
    return (
      <div className="client-gallery">
        <div className="gallery-header">
          <h2>üì∏ Wedding Photo Collection</h2>
          <button onClick={handleLogout} className="logout-btn">
            üîí Logout
          </button>
        </div>

        <div className="gallery-actions">
          <a 
            href={clientDriveLink} 
            target="_blank" 
            rel="noopener noreferrer"
            className="action-btn primary"
          >
            üìÅ Open Photo Gallery
          </a>
          <p className="access-info">
            You can view, download, and manage all photos in your private Google Drive folder.
          </p>
        </div>

        <div className="features-list">
          <h3>What you can do:</h3>
          <ul>
            <li>‚úÖ View all uploaded photos</li>
            <li>‚úÖ Download individual photos</li>
            <li>‚úÖ Download all photos as ZIP</li>
            <li>‚úÖ Delete unwanted photos</li>
            <li>‚úÖ Organize by folders</li>
          </ul>
        </div>
      </div>
    );
  }

  return (
    <div className="photo-collection">
      {/* Guest Upload Section */}
      <section className="upload-section">
        <div className="section-header">
          <h2>üì∏ Share Your Favorite Moments</h2>
          <p>Help us capture beautiful memories by uploading your photos from the wedding</p>
        </div>

        <div className="upload-instructions">
          <div className="instruction-card">
            <span className="number">1</span>
            <p>Click the upload button below</p>
          </div>
          <div className="instruction-card">
            <span className="number">2</span>
            <p>Fill in your name (optional)</p>
          </div>
          <div className="instruction-card">
            <span className="number">3</span>
            <p>Select up to 5 photos to upload</p>
          </div>
          <div className="instruction-card">
            <span className="number">4</span>
            <p>Submit the form</p>
          </div>
        </div>

        <div className="upload-actions">
          <a 
            href="https://docs.google.com/forms/d/e/1FAIpQLSfaxZNxxDgpwoP8I05_26L9rON_uoUiEeNVVWMrpDCvgAgWvA/viewform?usp=sf_link" 
            target="_blank" 
            rel="noopener noreferrer"
            className="upload-btn primary"
          >
            üì§ Upload Your Photos
          </a>

          <div className="upload-note">
            <p><strong>Note:</strong> Photos will be directly sent to the couple's private collection</p>
          </div>
        </div>
      </section>

      {/* Client Access Section */}
      <section className="client-access">
        <div className="client-section">
          <h3>For the Couple</h3>
          <button 
            onClick={() => setShowLogin(!showLogin)}
            className="client-toggle-btn"
          >
            {showLogin ? '‚ñ≤ Hide Access' : '‚ñº Access Photo Collection'}
          </button>

          {showLogin && (
            <div className="login-container">
              <form onSubmit={handleClientLogin} className="login-form">
                <div className="input-group">
                  <input 
                    type="password" 
                    value={clientPassword}
                    onChange={(e) => setClientPassword(e.target.value)}
                    placeholder="Enter access password" 
                    required 
                    className="password-input"
                  />
                  <button type="submit" className="login-btn">
                    üîë Access Photos
                  </button>
                </div>
                <p className="login-hint">
                  Enter the password provided to you to view all uploaded photos
                </p>
              </form>
            </div>
          )}
        </div>
      </section>
    </div>
  );
};

export default PhotoCollection;
